import { bus } from '@/event-bus';
export default {
  name: 'RotatorReset_data',
  data() {
    return {
      dialog: false
    };
  },
  methods: {
    reset() {
      this.$ajax.get(`api/reset?key=${localStorage.getItem('rotator_client_id')}`).then(() => {
        window.location.reload();
      });
      this.dialog = false;
      bus.$emit('is_admin', 0);
      bus.$emit('close_dialogs', 0);
    }
  }
};
